	display: flex;
	-ms-flex-align: center;
	align-items: center;
	-ms-flex-pack: center;
	justify-content: center;
	position: absolute;
	top: 120px;
	width: 30px;
	height: 60px;
	opacity: 0.5;
	border-radius: 15px;
	background-color: #fff;
	font-size: 16px;
	z-index: 10;
`;

export default HandleNextArrow;
